import React from 'react';
import './Solveques.css'

export function SolvequesForm() {
    return (
        <div className="board">
            <div className="main">
                <h1>나에게 맞는 문제를 <br/>추천해드립니다</h1>
                <p>인공지능이 수백개의 문제를 분석하여<br/>
                    나에게 맞는 문제를 추천합니다.<br/>
                    개선사항에 대한 의견을 게시판에서 들<br/>려주세요.
                </p>
            </div>
        </div>
    );
};
